import React from 'react'
import {AppBar, Toolbar, Typography} from '@material-ui/core';
const Navbar = () => {
  return (
    <nav>
        <AppBar position='static'>
         <Toolbar>
             <Typography>React Navbar Example</Typography>
         </Toolbar>
      </AppBar>
    </nav>
  )
}

export default Navbar
